	(8, 1, 1, '<h2><span>1 Set Kacamata Hitam Anak (Jonas &amp; Keith Sunglasses)</span></h2>\r\n<p><span>1 set Kacamata Hitam Anak (Jonas &amp; Keith Sunglasses) ini terdiri dari 1 pc kacamata yang bisa dilipat menjadi bentuk yang lebih ringkas. Dapat digunakan oleh anak laki-laki maupun perempuan.</span></p>\r\n<h2><span>Ukuran Kacamata Hitam Anak (Jonas &amp; Keith Sunglasses)</span></h2>\r\n<p><span>Untuk ukuran Kacamata Hitam Anak (Jonas &amp; Keith Sunglasses) tersedia dalam ukuran all size untuk anak berusia sekitar 1-4 tahun.</span></p>\r\n<h2><span>Warna Frame Kacamata Hitam Anak (Jonas &amp; Keith Sunglasses)</span></h2>\r\n<p><span>Warna Frame Kacamata Hitam Anak (Jonas &amp; Keith Sunglasses) ini tersedia dalam pilihan :</span></p>\r\n<ol><li><span>Kacamata Hitam Anak Warna Frame Pink</span></li>\r\n<li><span>Kacamata Hitam Anak Warna Frame Hijau</span></li>\r\n</ol><h2><span>Bahan Kacamata Hitam Anak (Jonas &amp; Keith Sunglasses)</span></h2>\r\n<p><span>Bahan Kacamata Hitam Anak (Jonas &amp; Keith Sunglasses) ini terbuat dari plastik yang halus, ringan, mudah dibersihkan. Sangat nyaman dan aman digunakan oleh anak anda.</span></p>\r\n<h2><span>Pemesanan Baju Bayi dan Baju Anak Online</span></h2>\r\n<p><span>Mohon maaf apabila kami tidak bisa memproses pesanan anda dikarenakan<strong><span>STOK TERBATAS</span>.</strong>Kami tidak menerima booking tanpa payment.<strong>Seluruh produk akan diproses packing dan dikirimkan</strong><strong>setelah pembayaran.</strong>Untuk pemesanan anda dapat menghubungi 081249018425 atau untuk lebih detailnya silakan kunjungi<strong><span><a href="http://bajubayiken.com/cara-order">halaman ini</a></span>.</strong></span></p>\r\n<h2><span>Pengiriman Baju Bayi dan Baju Anak Online</span></h2>\r\n<p><span>Untuk pengiriman baju bayi dan baju anak online BajuBayiKen.com menggunakan jasa ekspedisi pengiriman JNE dan POS. Untuk standar pengiriman baju bayi dan baju anak dari toko BajuBayiKen.com menggunakan<strong>JNE REGULER</stron